.Example

Import-Module Microsoft.Graph.Identity.DirectoryManagement

$params = @{
	directoryPropertyName = "CustomAttribute1"
	annotations = @(
		@{
			displayName = "Cost Center"
			localizations = @(
				@{
					languageTag = "ru"
					displayName = " "
				}
			)
		}
	)
}

New-MgAdminPeopleProfileCardProperty -BodyParameter $params


.Inputs
